import React from 'react';
import {CardContainer, ProfileContainer, SliderContainer, SubHeader} from './FriendCardElements';
import SideImage from './sideImage';
import Details from './Details';
import FriendSlider from '../FriendSlider/friendSlider';

const FriendCard = () => {
    return (
        <div>
            <ProfileContainer>
                <CardContainer>
                    <SideImage />
                    <Details />
                    <SliderContainer>
                        <h1>Personality</h1>
                        <FriendSlider />
                    </SliderContainer>
                </CardContainer>
            </ProfileContainer>

        </div>
    )
}

export default FriendCard;
